        <div><form onSubmit={() => console.log('send')}>
            <input value={value}
                onFocus={(event) => (event.target.value = "")}
                onChange={(event) => {
                    console.log([...event.target.value])
                    setValue(event.target.value)
                }} />
            <button type="submit">Find city</button>
        </form></div >
    )
}

export default Search
